import ExpenseItem from './ExpenseItems'
const Expenses = props => {
    
    let expenseContent = <p>No expense content.</p>
    if (props.items.length > 0) {
        expenseContent = props.items.le.map((item) => (<ExpenseItem key={item.id} title={item.title} amount={item.amount} date={item.date} />));
    }
};
export default ExpensesList ;
